import React from 'react';
import styled from 'styled-components';
import IntroSec1 from '../images/intro-sec1.png';

const Intro = () => {
  const introSec1 = IntroSec1;

  return (
    <div>
      <section>
        <img src={introSec1} alt="sec1" />
      </section>
    </div>
  );
};

export default Intro;
